Cara Mengukur Oksigen Darah:
1. Kenakan jam tangan selebar satu jari di bawah tulang pergelangan tangan, dan kenakan dalam posisi yang nyaman di pergelangan tangan; 
2. Setelah memasuki mode deteksi oksigen darah, harap tetap diam, pastikan pergelangan tangan Anda rata dan arloji menghadap ke atas. Jika Anda sedang duduk, Anda dapat meletakkan tangan di atas meja dengan jam tangan menghadap ke atas; 
3. Tolong jaga agar lengan Anda tetap stabil sampai Anda mendapatkan hasil akhir.
